    false,nt"url": null,nt"notes": "The purpose of this contingency plan is
    reduce waterfowl losses from disease, primarily avian botulism, along the eastern
    shore of the Great Salt Lake in Utah.  This plan contains the disease history, disease
    surveillance, disease response action including management options and logistics,
    biological considerations including species and population data, animal movement
    patterns, weather patterns and habitat and population manipulation potential, ad
